import React from 'react';
import Planeteer from './Planeteer';


useEffect(() => {
  fetch('db.json')
    .then(res => res.json())
    .then(data => {
      console.log(data);
      setPlaneteers(data.planeteers);
    });
}, []);


const PlaneteersContainer = ({ planeteers }) => {
  return (
    <div className="planeteers-container">
      <ul className="cards">
        {planeteers.map(planeteer => (
          <Planeteer key={planeteer.id} planeteer={planeteer} />
        ))}
      </ul>
    </div>
  );
};

export default PlaneteersContainer;
